import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          i m learning react.js from codewithharry for free and i m going to
          learn react and other frontend concepts asap.
          {console.log("hello world")}
        </a>
      </header>
    </div>
  );
}

export default App;
